import React from 'react';
import { AppBar, Toolbar, Typography, IconButton } from '@mui/material';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import SettingsIcon from '@mui/icons-material/Settings';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
// Importa el logo (asegúrate del nombre y extensión correctos)
import logo from '../assets/LogoAutoWhappBlanco.png';

const Header: React.FC = () => {
  return (
    <AppBar position="static" sx={{ background: 'linear-gradient(90deg,rgb(69, 79, 255) 65%,rgb(13, 25, 112) 85%)' }}>
      <Toolbar>
        {/* Logo a la izquierda */}
        <img
          src={logo}
          alt="Logo AutoWhapp"
          style={{
            height: 40,         // Ajusta el tamaño aquí si lo deseas
            width: 40,
            marginRight: 16,    // Espacio a la derecha del logo
            objectFit: 'contain'
          }}
        />
        <Typography variant="h6" sx={{ flexGrow: 1, fontFamily: 'Poppins', fontWeight: 'bold' }}>
          AutoWhapp
        </Typography>
        <IconButton sx={{ backgroundColor: 'rgb(13, 25, 112)', marginRight: 1, '&:hover': { backgroundColor: '#93C5FD' } }}>
          <HelpOutlineIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
        <IconButton sx={{ backgroundColor: 'rgb(13, 25, 112)', marginRight: 1, '&:hover': { backgroundColor: '#93C5FD' } }}>
          <SettingsIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
        <IconButton sx={{ backgroundColor: 'rgb(13, 25, 112)', '&:hover': { backgroundColor: '#93C5FD' } }}>
          <PersonOutlineIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
